import React, { Component } from "react";

import styles from "../css/Sidebar.css";

class Sidebar extends Component {
  state = {};
  render() {
    return (
      <div className={styles.sidenav}>
        <p>About</p>
        <p>Services</p>
        <p>Clients</p>
        <p>Contact</p>
      </div>
    );
  }
}

export default Sidebar;
